import React from "react";
import PosItem from "./PostItem";

const PostList = ({posts, title}) => {
    return (
        <div>

        <h1 style={{textAlign: 'center'}}>
            {title}
        </h1>
            {posts.map((post, index) => 
        <PosItem number={index + 1} post={post} key={post.id}/>
      )}
        </div>
    )
}

export default PostList;
